# Seleccionar la variable presión que esta en Pascales

msl = (dataset['msl'])


# 1. Calcular la climatología (promedio de 30 años) para cada punto de la cuadrícula
# Suponiendo que 'msl' es un xarray DataArray con dimensiones (tiempo, latitud, longitud)
climatologia = msl.groupby('time.dayofyear').mean(dim='time')

# 2. Calcular las anomalías restando la climatología de los valores diarios
anomalias = msl.groupby('time.dayofyear') - climatologia

