"""# Calculo de parámetro k

## Calculo de las Componentes Principales
"""

#Unir las variables que irán al K-means

data_array_normalized = np.hstack([msl_anom_array_normalized, z850_anom_array_normalized])

data_array_normalized

#PCA

# Aplicar PCA
pca = PCA(n_components=0.95)  # Retener el 95% de la varianza
principal_components = pca.fit_transform(data_array_normalized)

# Ver cuántas componentes seleccionó
print(f'Número de componentes seleccionadas: {pca.n_components_}')

#La inercia mide qué tan bien K-Means agrupó un conjunto de datos. Se calcula midiendo la distancia entre cada punto de datos y su centroide,
#Elevando al cuadrado esta distancia y sumando estos cuadrados en un grupo.
#Un buen modelo es aquel con baja inercia Y un número bajo de clusters (K). Sin embargo, esto es una compensación porque a medida que K aumenta, la inercia disminuye.

inertia = []

#Aca defino que quiero 10 grupos (k) para definir la curva y ver que cantidad optima
k_values = range(1, 11)

#el valor predeterminado n_init  cambiará a 'auto', lo que significa que el número de inicializaciones se ajustará automáticamente en función de la cantidad de centroides (clusters) que estás buscando
# para cada definición de k el algoritmo se ejecuta varias veces y el algoritmo se queda con la ejecución de menor inercia, es decir cuando la distancia a los centroides de los sub grupos es baja

for k in k_values:
    kmeans = KMeans(n_clusters=k, random_state=42)
    kmeans.fit(principal_components)
    inertia.append(kmeans.inertia_)

# Graficar la curva del codo (elbow curve)
plt.figure(figsize=(10, 6))
plt.plot(k_values, inertia, marker='o')
plt.title('Método Elbow - Número Optimo de Clusters')
plt.xlabel('Numero de Clusters (k)')
plt.ylabel('Inercia')
plt.show()

"""La curva de la inercia suele dar siempre 4 como un buen numero de k.![download.png](data:image/png;base64,)"""

# @title
