plt.title('Distribución de los Datos Normalizados')
plt.xlabel('Valor Normalizado')
plt.ylabel('Frecuencia')
plt.show()

"""# Calculo K-Means"""

# Elegir el número optimo de cluster en base al metodo ebow

num_clusters = 3

#Lo que hace el kmeans es agrupar datos de presión que se alejen de una media de forma similar. En el cluster 1 aparecen datos de presión que son mas cercanos a la media en esta epoca. esto esta bien?
#Agrupa los datos de tal manera que los puntos dentro de un mismo culster son  lo mas parecido entre ellos y diferente a los otros clusters.

#Definicion de los numeros de cluster y el random state que no me acuerdo que hace, tiene que ver con la inicialización creo.
kmeans = KMeans(n_clusters=num_clusters, random_state=42)

#Aplico Kmeans
#La salida es un vector que en cada lugar aparece un numero de cluster ya que para cada fila de la matriz normalizacion (cada instante) se asigna un cluster.
#Es decir todos los puntos del mapa a un determinado tiempo se le asigna un k

labels = kmeans.fit_predict(principal_components)

