from sklearn.metrics import silhouette_samples, silhouette_score
import matplotlib.pyplot as plt
import matplotlib.cm as cm
from sklearn.cluster import KMeans
# Calcular el índice de Silhouette -> Indice para saber si los objetos estan bien en su cluster o existe la posibilidad de que sean cercanos a otro. Indice positivo buen emparejamiento, negativo malo

# Definir el rango de valores k que queremos probar
k_values = range(2, 6)

plt.figure(figsize=(15, 10))

for i, k in enumerate(k_values):
    # Aplicar KMeans
    kmeans = KMeans(n_clusters=k, random_state=42)
    labels = kmeans.fit_predict(principal_components)

    # Calcular el índice de Silhouette promedio
    silhouette_avg = silhouette_score(principal_components, labels)

    # Calcular los valores de Silhouette para cada punto
    sample_silhouette_values = silhouette_samples(principal_components, labels)

    y_lower = 10
    plt.subplot(2, 2, i + 1)

    for j in range(k):
        # Agregar los valores de Silhouette de cada cluster
        ith_cluster_silhouette_values = sample_silhouette_values[labels == j]
        ith_cluster_silhouette_values.sort()

        size_cluster_j = ith_cluster_silhouette_values.shape[0]
        y_upper = y_lower + size_cluster_j

        color = cm.nipy_spectral(float(j) / k)
        plt.fill_betweenx(np.arange(y_lower, y_upper),
                          0, ith_cluster_silhouette_values,
                          facecolor=color, edgecolor=color, alpha=0.7)

        # Etiquetar el gráfico con el número de cluster en el medio
        plt.text(-0.05, y_lower + 0.5 * size_cluster_j, str(j))

        y_lower = y_upper + 10  # 10 para el espacio entre clusters

    # Configuraciones del gráfico
    plt.title(f"Silhouette para k = {k} \n Índice de Silhouette promedio: {silhouette_avg:.2f}")
    plt.xlabel("Índice de Silhouette")
    plt.ylabel("Número de Cluster")
    plt.axvline(x=silhouette_avg, color="red", linestyle="--")
    plt.yticks([])
    plt.xticks(np.arange(-0.1, 0.5, 0.1))

plt.tight_layout()
plt.show()

