#Funcion para ir a buscar los datos de pimet de cada año

def procesar_datos_meteorologicos():
    ruta_base = '/content/drive/MyDrive/facu/Tesis/Datos/Pimet'
    años = ['2020', '2021', '2022', '2023']

    df_total = pd.DataFrame()

    for año in sorted(años):
        ruta_año = os.path.join(ruta_base, año)
        if os.path.isdir(ruta_año):
            for archivo in os.listdir(ruta_año):
                ruta_archivo = os.path.join(ruta_año, archivo)
                print(f"Procesando archivo: {ruta_archivo}")  # Mensaje de depuración

                if archivo.endswith('.sql') or archivo.endswith('.txt'):
                    try:
                        # Leer el archivo .sql o .txt como texto
                        with open(ruta_archivo, 'r') as file:
                            lines = file.readlines()
                            # Verificar si el archivo tiene una fila de encabezado
                            if 'fecha' in lines[0]:  # Suponiendo que la primera fila contiene los encabezados
                                lines = lines[1:]  # Eliminar la primera fila que contiene los encabezados
                            df_sql = pd.DataFrame([line.strip().split(',') for line in lines])
                            df_sql.columns = ['fecha', 'id_pimet', 'tmax', 'tmin', 'pron', 'max_proba_rain']
                            # Especificar el formato de fecha
                            df_sql['fecha'] = pd.to_datetime(df_sql['fecha'].str.strip('"'), format='%Y-%m-%d %H:%M:%S', errors='coerce')
                            df_total = pd.concat([df_total, df_sql], ignore_index=True)
                            print(f"Archivo {archivo} leído correctamente.")
                    except Exception as e:
                        print(f"Error al leer el archivo {archivo}: {e}")

                elif archivo.endswith('.csv'):
                    try:
                        df = pd.read_csv(ruta_archivo, sep=',', low_memory=False)
                        df_total = pd.concat([df_total, df], ignore_index=True)
                        print(f"Archivo CSV {archivo} leído correctamente.")
                    except Exception as e:
                        print(f"Error al leer el archivo CSV {archivo}: {e}")

    return df_total

#Aplico la funcion
df_total = procesar_datos_meteorologicos()
