def calcular_plazos(row):
    fecha = pd.to_datetime(row['nueva_fecha'])
    corrida = pd.to_datetime(row['fecha'])
    diferencia = fecha - corrida
    dias = diferencia.days
    if dias == 0:
        return int(0)
    elif dias == 1:
        return int(1)
    elif dias == 2:
        return int(2)
    elif dias == 3:
        return int(3)
    elif dias == 4:
        return int(4)
    elif dias == 5:
        return int(5)
    elif dias == 6:
        return int(6)
    elif dias == 7:
        return int(7)
    elif dias == 8:
        return int(8)
